@Test
  public void testFromTo() {
    final A a = new A();
    a.setAnInt(1);
    a.setAString("Foo");
    final B b = (B) JacksonUtil.fromTo(a, null, null, B.class);
    assertEquals(1, b.anInt);
    assertEquals("Foo", b.aString);
  }

